import classes from "./NavigationBar.module.css";
import { Link } from "react-router-dom";
import { animateScroll as scrollAnimation } from "react-scroll";

const NavigationBar = (props) => {
  const scrollToComponent = () => {
    scrollAnimation.scrollTo("yourComponentId", {
      duration: 800,
      smooth: "easeInOutQuart",
    });
  };

  return (
    <div className={classes.navbar}>
      <div className={classes.navBrandNameContainer}>
        <h1 className={classes.navBrandName}>
          <Link
            to="/"
            style={{ color: "white", textDecoration: "none" }}
            href="https://www.w3schools.com/"
          >
            START BOOTSTRAP
          </Link>
        </h1>
      </div>
      <ul className={classes.navMenuList}>
        <li className={classes.navItem}>
          <Link
            to="/portfolio"
            onClick={scrollToComponent}
            className={classes.link}
          >
            PORTFOLIO
          </Link>
        </li>
        <li className={classes.navItem}>
          <Link to="/about" className={classes.link}>
            ABOUT
          </Link>
        </li>
        <li className={classes.navItem}>
          <Link to="/contact" className={classes.link}>
            CONTACT
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default NavigationBar;
